import React from 'react';
import { Link } from 'react-router-dom';

export default function Page() {
  const categories = [
    {
      title: 'Sorting',
      algorithms: [
        { name: 'Bubble Sort', path: '/sorting/bubble-sort' },
        { name: 'Quick Sort', path: '/sorting/quick-sort' },
        { name: 'Merge Sort', path: '/sorting/merge-sort' },
        { name: 'Insertion Sort', path: '/sorting/insertion-sort' },
      ]
    },
    {
      title: 'Searching',
      algorithms: [
        { name: 'Linear Search', path: '/searching/linear-search' },
        { name: 'Binary Search', path: '/searching/binary-search' },
      ]
    },
    {
      title: 'Data Structures',
      algorithms: [
        { name: 'Linked List', path: '/data-structures/linked-list' },
        { name: 'Binary Tree', path: '/data-structures/binary-tree' },
        { name: 'Stack', path: '/data-structures/stack' },
        { name: 'Queue', path: '/data-structures/queue' },
      ]
    }
  ];

  return (
    <div className="min-h-screen bg-background">
      <main className="container mx-auto px-4 py-8">
        <h1 className="text-4xl font-bold text-center mb-12 text-primary">DSA Concepts</h1>
        
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {categories.map((category) => (
            <div key={category.title} className="bg-card rounded-lg shadow-lg p-6">
              <h2 className="text-2xl font-semibold mb-4 text-card-foreground">{category.title}</h2>
              <div className="space-y-2">
                {category.algorithms.map((algorithm) => (
                  <Link
                    key={algorithm.name}
                    to={algorithm.path}
                    className="block p-3 bg-secondary hover:bg-accent rounded-md transition-colors duration-200"
                  >
                    <span className="text-secondary-foreground">{algorithm.name}</span>
                  </Link>
                ))}
              </div>
            </div>
          ))}
        </div>
      </main>
    </div>
  );
}
